import NavBar from "./NavBar";
import { useContext } from "react";
import { StoreContext } from "../store/StoreContext";

export const BrandPage = () => {
  const { store } = useContext(StoreContext);
  const userEmail = store.user.email;
  const userRole = store.user.role;
  return (
    <div className="bg-[#F2F2F2]">
      <NavBar />
      <div className="flex">
        <section>
          <div>Analytix</div>
        </section>
        <section className="w-[80vw] h-[33.7vw] bg-[#fff] flex justify-end">
        <div className="w-[77.3vw] h-[7.8vw] bg-gradient-to-r from-[#70A9FF] via-[#316EC9] to-[#0149B4] text-[28px] font-bold text-white pr-6 pt-11">
          Your Profile
        </div>
      </section>
      </div>

    </div>
  );
};
